  {
   "name": "page3.1",
   "elements": [
    {
     "type": "html",
     "name": "question49",
     "width": "600px",
     "minWidth": "600px",
     "maxWidth": "600px",
     "html": "<p style=\"text-align:left;color:black;font-size:16px\">If you agree for you and or your child to participate, we will ask you to take part in completing one to two visits, either during your pregnancy, at less than 1 month of age for your child, or between 3-9 months of age for your child. These visits will take place in-person, or some parts may be done remotely. The length of visits will vary, and may last between approximately one to seven hours per visit (which can be broken up into multiple visits). This will include completing interviews, questionnaires and other tests about yourself and or your child for the visits that are planned for the first year of the study. We may ask you and or your child to wear small devices for a few days to measure heart rate and or movement. We may ask you and or your child to provide some biological samples. Because this study is looking at how a child’s brain develops in the first years of life, we may ask that you allow your child to have brain scans and other measures of how your child’s brain is developing.  </p>\n\n<p style=\"text-align:left;color:black;font-size:16px\"> The most serious potential risks of the study are the social and legal risks that could result from a required report to the Department of Human Resources (DHR) if we know or suspect abuse or neglect of a child, including physical, sexual, emotional abuse or use of illegal substances. A report to DHR can result in DHR removing your child from the home. DHR may also report to law enforcement, which could result in you being put in jail due to the Alabama’s Chemical Endangerment of a Child Law. In addition, the other serious risk is the loss of your or your child’s confidentiality if we mistakenly share your information with someone outside the study or if you self-disclose any substance use. We have many levels of protection in place to prevent this from happening.</p>\n\n<p><br /></p><h4 style=\"text-align:Leftt\">\nVersion 11/15/2022</h4><p></p>"
    }
   ],
   "visibleIf": "{fromInternal} = 'Yes'"
