     "name": "question3",
     "width": "600px",
     "minWidth": "600px",
     "maxWidth": "600px",
     "html": "<ul style=\"font-size:16px;color:black\">\n<li>Research is voluntary - whether or not you agree for you and or your child to participate in this research is your decision. You can discuss your decision with others (such as family, friends, or your or your child’s doctor).</li>\n\n<li>You can say yes but change your mind later.</li>\n\n<li>If you say no, we will not hold your decision against you or your child, and your decision will not affect your or your child’s health care or any other benefits you or your child may be entitled to.</li>\n\n<li>Please ask questions or mention concerns before, during or after the research</li>\n</ul>\n\n\n<p style=\"text-align:left;color:black;font-size:16px\"> Additional, detailed information about this research is provided below. </p>\n\n\n\n<br /><h4 style=\"text-align:left\"><b><i>\nWhy you and your child have been asked to participate, how you and your child were selected, and what is the approximate number of participants in the study? </i></b></h4>\n\n<p style=\"text-align:left;color:black;font-size:16px\">You and or your child have been asked to participate in this pilot study because you live in the Birmingham metro area, you are pregnant or you have a child 9 months of age or younger. There will be approximately 150 birth parents and their children participating at the UAB site. There will be approximately 7,500 birth parent-child pairs participating at all 25 sites across the United States. </p>\n"
    }
