    {
     "type": "html",
     "name": "question19",
     "width": "600px",
     "minWidth": "600px",
     "maxWidth": "600px",
     "html": "<p style=\"text-align:left;color:black;font-size:16px\">The brain MRI visits will be scheduled the MRI center located at the UAB Highlands Hospital. We will give you directions and free parking. Because MRI involves being placed in a strong magnetic field, it is not safe for your child to be in or near an MRI scanner if they have metal on their body, such as pierced earrings. You will be asked to remove anything metallic from your child before the scan.</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">For the MRI scan, we will ask you to bring your child in at a time that matches their usual feeding and sleeping time (nap or bedtime). Generally, babies tend to fall asleep after they eat, so we take advantage of this and scan them while asleep. We will use the “Feed and Wrap” technique when you and your child arrive for the scan. You will be provided with a quiet, private space with a rocking chair to feed your child, and then we will help you swaddle your infant. Once they are asleep, we will place your child in an MRI-safe pappose (inflatable bed with cushions and adjustable straps) to help them stay still and comfortable while being scanned. MRI machines can be loud, so we will use three layers of hearing protection (ear plugs, ear covers, and headphones) to help your baby stay asleep and protect their hearing. A trained research assistant will stay bedside with your child while they are being scanned, and you can watch from nearby. As your child gets older, you will have the option to bring them in at night to coincide with their natural bedtime. Using these strategies will allow us to obtain images of your baby’s brain without using sedation or anesthesia.</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">The EEGs will be done at the UAB Civitan International Research Center. Your child will wear a special head “net” or cap for a brief period of time while doing the study tasks. </p>"
    }
   ],
