     "width": "600px",
     "minWidth": "600px",
     "maxWidth": "600px",
     "html": "<h4 style=\"text-align:left\"><b><i>Who can you call if you have questions?</i></b></h4>\n\n<p style=\"text-align:left;color:black;font-size:16px\">This study has been explained to you and your questions have been answered. If you have other questions or research-related problems, you may reach Dr. Peralta-Carcelen at 205-934-4680.</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">If you have questions about your rights as a research participant, or concerns or complaints about the research, you may contact the UAB Office of the IRB (OIRB) at (205) 934-3789 or toll free at 1-855-860-3789. Regular hours for the OIRB are 8:00 a.m. to 5:00 p.m. CT, Monday through Friday. You may also call this number in the event the research staff cannot be reached, or you wish to talk to someone else.</p>\n\n"
