     "name": "question5",
     "maxWidth": "600px",
     "html": "<h4 style=\"text-align:Right\">UCSD Project 802055</h4>\n<h4 style=\"text-align:Right\">Adult Consent</h4>\n\n<br /><h3 style=\"text-align:center\"> <b>University of Alabama at Birmingham</b></h3>\n\n<h3 style=\"text-align:center\"> <b>AUTHORIZATION FOR USE/DISCLOSURE OF PROTECTED HEALTH INFORMATION (PHI) FOR RESEARCH</b></h3> \n"
    },
    {
     "type": "panel",
     "name": "panel1",
     "elements": [
      {
       "type": "text",
       "name": "question64",
       "maxWidth": "300px",
       "title": "Participant Name",
