       "hideNumber": true,
       "html": "<p style=\"font-size:16px;color:black\"><b>UAB IRB Protocol Number:</b> IRB-300008718</p>"
      },
      {
       "type": "html",
       "name": "question67",
       "maxWidth": "300px",
       "html": "<p style=\"font-size:16px;color:black\"><b>Research Protocol:</b> The HEALthy Brain and Child Development (HBCD) Study</p>"
      },
      {
       "type": "html",
       "name": "question66",
       "maxWidth": "300px",
       "startWithNewLine": false,
       "hideNumber": true,
       "html": "<p style=\"font-size:16px;color:black\"><b>Principal Investigator:</b> Myriam Peralta-Carcelen</p>\n<p style=\"font-size:16px;color:black\"><b>Sponsor:</b> National Institutes of Health</p>"
      }
     ],
     "maxWidth": "600px"
    },
    {
     "type": "html",
     "name": "question27",
     "maxWidth": "600px",
     "html": "<p style=\"text-align:left;color:black;font-size:16px\"><b>What is the purpose of this form?</b>  You are being asked to sign this form so that UAB may use and release your protected health information for research. Participation in research is voluntary. If you choose to participate in the research, you must sign this form so that your protected health information may be used for the research.</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\"><b>Why do the researchers want my protected health information?</b>  The researchers want to use your protected health information as part of the research protocol listed above and as described to you in the informed consent.</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\"><b>What protected health information do the researchers want to use?</b>  All medical information, from during pregnancy, delivery, and post-partum up to 6 weeks. In addition, medical record information would include your child’s medical records from birth until the end of the study. The medical information will include all personal identifiers, including but not limited to your name, social security number, medical record number, date of birth, dates of service, etc.; any examinations, laboratory results, imaging studies, any diagnosis or treatment of disease, and reports and treatments of whatever kind that happened during pregnancy, delivery, immediate post-partum, and/or during your child’s time in our study, including but not limited to drug/alcohol treatment, psychiatric/psychological treatment; and any other information related to or collected for use in the research protocol, regardless of whether the information was collected for research or non-research (e.g., treatment) purposes.</p>"
    }
   ],
   "visibleIf": "{fromInternal} = 'Yes'"
  },
  {
   "name": "page23",
   "elements": [
    {
     "type": "html",
     "name": "question8",
     "maxWidth": "600px",
     "html": "<p style=\"text-align:left;color:black;font-size:16px\"><b>Who will disclose, use and/or receive my protected health information?</b>  All Individuals/entities listed in the informed consent documents, including but not limited to, the physicians, nurses and staff and others performing services related to the research (whether at UAB or elsewhere); other operating units of UAB, HSF, UAB Highlands, Children’s of Alabama, and the Jefferson County Department of Health, as necessary for their operations; the IRB and its staff; the sponsor of the research and its employees and agents, including any CRO; and any outside regulatory agencies, such as the Food and Drug Administration, providing oversight or performing other legal and/or regulatory functions for which access to participant information is required.</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\"><b>How will my protected health information be protected once it is given to others?</b>  Your protected health information that is given to the study sponsor will remain private to the extent possible, even though the study sponsor is not required to follow the federal privacy laws. However, once your information is given to other organizations that are not required to follow federal privacy laws, we cannot assure that the information will remain protected.</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\"><b>How long will this Authorization last?</b>  Your authorization for the uses and disclosures described in this Authorization does not have an expiration date.</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\"><b>Can I cancel this Authorization?</b>  You may cancel this Authorization at any time by notifying the Principal Investigator, in writing, referencing the research protocol and IRB Protocol Number. If you cancel this Authorization, the study doctor and staff will not use any new health information for research. However, researchers may continue to use the protected health information that was provided before you cancelled your authorization.</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\"><b>Can I see my protected health information?</b>  You have a right to request to see your protected health information. However, to ensure the scientific integrity of the research, you will not be able to review the research information until after the research protocol has been completed.</p>"
    }
   ],
