     "html": "<h4 style=\"text-align:Right\">\nUCSD Project 802055</h4>\n\n<h4 style=\"text-align:Right\">\nScreening Script</h4>\n\n<h3 style=\"text-align:center\"><p><b>\nUniversity of Alabama at Birmingham</b></p></h3>\n\n<h3 style=\"text-align:center\"><p><b>\nScreening Script with Consent</b></p></h3>\n\n<h4 style=\"text-align:center\"><p><b>\nThe HEALthy Brain and Child Development (HBCD) Study</b></p></h4>\n\n"
